import React from "react";
import "./Sidebar.css";
import SidebarRow from "./SidebarRow";

function Sidebar() {
  return (
    <div className="Sidebar">
      <h2>Sidebar</h2>

      <SidebarRow icon={HomeIcon} title="Home" />
      <SidebarRow title="Trending" />
      <SidebarRow title="Subscription" />
    </div>
  );
}

export default Sidebar;
